webpackJsonp([60935884062322],{726:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Solar Sailer",description:"I am a developer, designer and product manager from France. Co-founder of Pixelnest Studio.",author:"Matthieu Oger",siteUrl:"https://solarsailer.net/"}},markdownRemark:{html:'<blockquote>\n<p>Could "changing the world" be a contender the most trite, overused expression of 2013? Recent grads seem to have adopted it en masse as their personal tagline. It\'s a nice sentiment, but it hard not to roll your eyes when every 23 year old applies it to his mobile phone app with no users that he threw together in a couple weeks.</p>\n<p>[…]</p>\n<p>Besides, I\'m not even sure it\'s a healthy sentiment for most people. If your focus is as broad as "changing the world," you\'re probably setting yourself up to feel like a failure.</p>\n<p>— <a href="https://news.ycombinator.com/item?id=6108967">Freyr, Hacker News</a></p>\n</blockquote>\n<p>(via <a href="http://wolfslittlestore.be/2013/08/changing-the-world/">Wolf\'s Little Store</a>)</p>',frontmatter:{date:"2013-08-02",readableDate:"02 August 2013",title:'Quote — "Changing the world."',showPageTitle:null,excerptLine:null,excerptQuote:{name:"Freyr",quote:"Could “changing the world” be a contender the most trite, overused expression of 2013?"}},fields:{path:"/2013/08/quote-changing-the-world/"}}},pathContext:{id:"/Users/ashen/Code/solarsailer.net/content/posts/2013-08-02-quote-changing-the-world.md absPath of file >>> MarkdownRemark"}}}});
